import "./index.css";
import { useGlobalContext } from "./context";
import { useEffect } from "react";

export const LogIn = () => {
  const { state, logInFunc } = useGlobalContext();
  const fetchDataBase = async (uname) => {
    const response = await fetch("https://jsonplaceholder.typicode.com/users");
    const data = await response.json();
    console.log(data);
    data.find((member) => {
      if (member.username === uname) {
        logInFunc(uname);
      }
      return <p>you are not a member</p>;
    });
  };
  return (
    <div className="log">
      <form
        className="form"
        onSubmit={(e) => {
          e.preventDefault();
          fetchDataBase(e.target.uname.value);
        }}
      >
        <div className="formdiv">
          <label htmlFor="uname">
            <b>Username</b>
          </label>
          <input type="text" placeholder="Enter Username" name="uname" />
          <br />

          <label htmlFor="psw">
            <b>Password</b>
          </label>
          <input type="password" placeholder="Enter Password" name="psw" />
          <br />
          <button type="submit" className="button">
            Login
          </button>
          <br />
          <button type="button" className="cancelbtn">
            Cancel
          </button>
        </div>
      </form>

      {!state.logedIn && <p>pls enter first</p>}
    </div>
  );
};
